    'We could not check to see if basic authentication and rewrite extensions have been activated. Please manually check if they\'ve been activated in order to use the PrestaShop webservice.' => 'Nu putem verifica daca autentificarea si rescrierea extensiilor primare sunt active. Verifica manual acest lucru pentru a putea folosi PrestaShop Webservice.',
