    'How to restore a database backup' => 'Cum se restaureaza o copie de rezerva a bazei de date',
    'If you need to restore a database backup, we invite you to subscribe to a [1][2]technical support plan[/2][/1].' => 'In cazul in care ai nevoie sa restaurezi copia de rezerva a bazei de date, te invitam sa te abonezi la un [1][2]planul de asistenta tehnica[/2][/1].',
