    'Your shop is hosted by PrestaShop. Although you can create backup files here below, there are core settings you cannot access for security reasons, like the database management. Thus, only our team can proceed to a restoration.' => 'Magazinul tau este gazduit de PrestaShop. Desi ai posibilitatea sa creezi fisiere de rezerva aici mai jos, exista setari de baza pe care nu le poti accesa din motive de securitate, cum ar fi administrarea bazei de date. De aceea, numai echipa noastra poate realiza o restaurare.',
