  array (
    'Does not apply to the shipping costs' => 'Nu se aplica costurilor de livrare',
    'Optional: The cart rule will be available to everyone if you leave this field blank.' => 'Optional: regula pentru cosul de cumparaturi va fi disponibila pentru oricine daca se lasa gol acest camp.',
    'The default period is one month.' => 'Perioada implicita este de o luna.',
    'You can choose a minimum amount for the cart either with or without the taxes and shipping.' => 'Se poate alege o valoare minima pentru cos, fie cu sau fara taxe si transport incluse.',
