    'This is the code users should enter to apply the voucher to a cart. Either create your own code or generate one by clicking on "Generate".' => 'Acesta este codul pe care utilizatorii trebuie sa-l introduca pentru a folosi cuponul intr-un cos. Fie creeaza propriul tau cod, fie genereaza unul apasand pe "Genereaza".',
