    'If the voucher is not yet in the cart, it will be displayed in the cart summary.' => 'Daca cuponul nu este inca in cos, va fi afisat in sumarul cosului.',
    'Only applicable if the voucher value is greater than the cart total.' => 'Se aplica doar daca valoarea cuponului este mai mare decat totalul cosului.',
    'If you do not allow partial use, the voucher value will be lowered to the total order amount. If you allow partial use, however, a new voucher will be created with the remainder.' => 'Daca nu permiti utilizarea partiala, valoarea cuponului va fi micsorata pana la valoarea totalului comenzii. Daca permiti utilizarea partiala, va fi creat un cupon nou cu suma ramasa.',
    'Cart rules are applied by priority. A cart rule with a priority of "1" will be processed before a cart rule with a priority of "2".' => 'Regulile de cos sunt aplicate in functie de prioritate. O regula de cos cu prioritatea "1" va fi procesata inaintea uneia cu prioritatea "2".',
    'If you want a category to appear in the menu of your shop, go to [1]Modules > Modules & Services > Installed modules.[/1] Then, configure your menu module.' => 'Daca vrei ca o categorie sa apara in meniul magazinului tau, intra in [1]Module > Module si servicii > Module instalate.[/1] Apoi configureaza modulul meniului tau.',
    'Recommended dimensions (for the default theme): %1spx x %2spx' => 'Dimensiuni recomandate (pentru tema implicita): %1spx x %2spx',
    'If you want a category to appear in the menu of your shop, go to [1]Modules > Modules Manager.[/1] Then, configure your menu module.' => 'Daca vrei ca o categorie sa apara in meniul magazinului tau, intra in [1]Module > Administrare module.[/1] Apoi, configureaza modulul meniului.',
    'Your internal name for this attribute.' => 'Numele intern al acestui atribut.',
    'The public name for this attribute, displayed to the customers.' => 'Numele public (vizibil clientilor) al acestui atribut.',
    'The way the attribute\'s values will be presented to the customers in the product\'s page.' => 'Modul in care valorile acestui atribut vor fi prezentate clientilor in pagina produsului.',
    'Choose the attribute group for this value.' => 'Alege grupul de atribute pentru aceasta valoare.',
    'Choose a color with the color picker, or enter an HTML color (e.g. "lightblue", "#CC6600").' => 'Alege o culoare folosind paleta de culori sau introduci o culoare HTML (ex. "lightblue", "#CC6600").',
    'Upload an image file containing the color texture from your computer.' => 'Incarca din calculatorul tau o imagine ce contine textura.',
    'This will override the HTML color!' => 'Aceasta operatiune va suprascrie culoarea HTML!',
    'Save then add another value' => 'Salveaza si apoi adauga alta valoare',
    'To add "tags," click in the field, write something, and then press "Enter."' => 'Pentru a adauga "etichete" da clic in camp, scrie ceva si apasa "Enter"',
    'Allow customers to upload files using the contact page.' => 'Se permite clientilor sa incarce fisiere folosind pagina de contact.',
    'Please fill out the message fields that appear by default when you answer a thread on the customer service page.' => 'Introdu mesajul care apare in mod implicit cand se raspunde la o discutie din pagina de serviciu clienti.',
    'URL for your IMAP server (ie.: mail.server.com).' => 'URL pentru server-ul tau IMAP (ex.: mail.server.com).',
    'Port to use to connect to your IMAP server.' => 'Port utilizat pentru conectarea la server-ul tau IMAP.',
    'User to use to connect to your IMAP server.' => 'Utilizator pentru conectarea la server-ul tau IMAP.',
    'Password to use to connect your IMAP server.' => 'Parola utilizata pentru conectarea la server-ul tau IMAP.',
    'Delete messages after synchronization. If you do not enable this option, the synchronization will take more time.' => 'Stergi mesajele dupa sincronizare. Daca nu activeaza aceasta optiune, sincronzarea va dura mai mult timp.',
    'Create new threads for unrecognized emails.' => 'Creeaza noi discutii pentru mesajele necunoscute.',
    'Use POP3 instead of IMAP.' => 'Foloseste POP3 in loc de IMAP.',
    'Do not use RSH or SSH to establish a preauthenticated IMAP sessions.' => 'Nu folosi RSH sau SSH pentru stabilirea unei sesiuni IMAP preautentificate.',
    'Use the Secure Socket Layer (TLS/SSL) to encrypt the session.' => 'Cripteaza sesiunea cu TLS/SSL.',
    'Validate certificates from the TLS/SSL server.' => 'Validare certificate de la serverul TLS/SSL.',
    'Do not validate certificates from the TLS/SSL server. This is only needed if a server uses self-signed certificates.' => 'Nu utilizeaza validarea certificatelor de la serverul TLS/SSL. Acest lucru este necesar doar daca serverul foloseste certificate semnate automat.',
    'Force use of start-TLS to encrypt the session, and reject connection to servers that do not support it.' => 'Fortare folosire start-TLS pentru criptarea sesiunii si respingerea conexiunilor la serverele care nu o suporta.',
    'Do not use start-TLS to encrypt the session, even with servers that support it.' => 'Nu se foloseste start-TLS pentru criptarea sesiunii nici chiar cu serverele care il suporta.',
    'Add new feature value' => 'Adauga o valoare',
    'Save and add another value' => 'Salveaza si adauga alta valoare',
    'Back to the list' => 'Inapoi la lista',
    'Add new feature values' => 'Adauga valori noi caracteristicii',
    'To add "tags," click inside the field, write something, and then press "Enter."' => 'Pentru a adauga etichete, clicaie in casuta, scrie numele etichetei si apoi apasa "Enter".',
    'Company name for this brand' => 'Numele firmei pentru aceasta marca',
    'Company name for this supplier' => 'Numele firmei pentru acest furnizor',
    'To add "tags" click in the field, write something and then press "Enter".' => 'Pentru a adauga etichete, clicaie in casuta, scrie numele etichetei si apoi apasa "Enter".',
    'Phone number for this supplier' => 'Numarul de telefon al acestui furnizor',
    'Mobile phone number for this supplier.' => 'Numarul de mobil al acestui furnizor.',
    'Create a new product: CTRL+P' => 'Creeaza un produs nou: CTRL+P',
    'To have a different title from the category name, enter it here.' => 'Pentru a avea un titlu diferit de numele categoriei, introdu-l aici.',
    'To have a different description than your category summary in search results page, write it here.' => 'Daca doresti ca descrierea categoriei din paginile cu rezultatele cautarii sa fie diferita de rezumatul categoriei, introduce-o aici.',
    'Unless the \'Accented URL\' option is enabled (in Shop parameters > Traffic & SEO), only letters, numbers, underscores (_), and hyphens (-) are allowed.' => 'Daca optiunea "URL cu diacritice" nu este activata (in Parametri magazin > Trafic si SEO), sunt permise numai litere, cifre, linii joase sau cratime.',
    'Search for a product' => 'Cauta un produs',
    'Enter your product name' => 'Introdu numele produsului tau',
    'The summary is a short sentence describing your product.<br />It will appears at the top of your shop\'s product page, in product lists, and in search engines\' results page (so it\'s important for SEO). To give more details about your product, use the "Description" tab.' => 'Rezumatul este o propozitie scurta care descrie produsul. <br/>Acesta va aparea in partea de sus a paginii produsului magazinului tau, in listele de produse, precum si in pagina de rezultatele a motoarelor de cautare (deci este important pentru SEO). Pentru a da mai multe detalii despre produsul tau, utilizeaza fila "Descriere".',
    'Search and add a related product' => 'Cauta si adauga un produs asociat',
    'Use a comma to create separate tags. E.g.: dress, cotton, party dresses.' => 'Foloseste o virgula pentru a crea taguri separate. De exemplu: rochie, bumbac, rochii de petrecere.',
    'Per kilo, per litre' => 'Pe kilogram, pe litru',
    'Combine several attributes, e.g.: "Size: all", "Color: red".' => 'Combina cateva atribute, de exemplu, "Dimensiunea: toate", "culoarea: rosie".',
    'Leave empty to disable' => 'Lasa gol pentru a dezactiva',
    'To have a different title from the product name, enter it here.' => 'Pentru a avea un titlu diferit de numele produsului, introdu-l aici.',
    'Public title for the product\'s page, and for search engines. Leave blank to use the product name. The number of remaining characters is displayed to the left of the field.' => 'Denumirea publica pentru pagina produsului, precum si pentru motoarele de cautare. Lasa necompletat pentru a utiliza numele produsului. Numarul de caractere ramase este afisat in partea stanga a campului.',
    'To have a different description than your product summary in search results pages, write it here.' => 'Pentru a avea o descriere diferita de rezumatul produsului in paginile cu rezultatele cautarii, scrieti-l aici.',
    'This description will appear in search engines. You need a single sentence, shorter than 160 characters (including spaces)' => 'Aceasta descriere apare sub rezultatul furnizat de motoarele de cautare. Ai nevoie de o singura fraza, care sa fie mai scurta de 160 de caractere (incluzand si spatiile)',
    'To which product the page should redirect?' => 'La ce produs trebuie redirectionata pagina?',
    'To which category the page should redirect?' => 'La ce categorie trebuie redirectionata pagina?',
    'If no category is selected the Main Category is used' => 'Daca nu este selectata nicio categorie, va fi folosita categoria principala',
    'Upload a brand logo from your computer.' => 'Incarca din calculatorul tau un logo al marcii.',
    'If you want to quickly create a new category, you can do it here. Don’t forget to then go to the Categories page to fill in the needed details (description, image, etc.). A new category will not automatically appear in your shop\'s menu, please read the Help about it.' => 'Daca doresti sa creezi rapid o categorie noua, o poti face aici. Nu uita sa completezi apoi detaliile necesare (descriere, imagine etc.) pe pagina Categorii. Categoria nou creata nu va aparea automat in meniul magazinului tau - gasesti informatii despre aceasta facand clic pe Ajutor.',
    'This interface allows you to specify the suppliers of the current combination.' => 'Aceasta interfata iti permite sa specifici furnizorii combinatiei curente.',
    'Using another image as cover will automatically uncheck this box.' => 'Utilizarea altei imagini ca imagine principala va debifa automat aceasta caseta.',
    'This is the net sales price for your customers. The retail price (tax incl.) will automatically be calculated using the selected tax rate.' => 'Acesta este pretul net de vanzare catre clientii tai. Pretul cu amanuntul (incluzand taxele) va fi calculat automat pe baza ratei de schimb alese.',
    'Indicate the price for a single unit of the product. For instance, if you\'re selling fabrics, it would be the price per meter.' => 'Indica pretul unei singure unitati de produs. De exemplu, daca vinzi tesaturi, va fi pretul pe metru.',
    'This description will appear in search engines. It should be a single sentence, shorter than 160 characters (including spaces).' => 'Aceasta descriere apare in listele furnizate de motoarele de cautare. Ar trebui sa fie o singura fraza, care sa fie mai scurta de 160 de caractere (incluzand si spatiile).',
    'Public title for the product page, and for search engines. Leave blank to use the product name. The number of remaining characters is displayed to the right of the field.' => 'Titlul paginii produsului, folosit si pentru motoarele de cautare. Lasa necompletat pentru a utiliza numele produsului. Numarul de caractere ramase este afisat in partea stanga a campului.',
    'Will appear in the list of suppliers.' => 'Apare in lista furnizorilor.',
    'Upload a supplier logo from your computer.' => 'Incarca din calculatorul tau sigla unui furnizor.',
    'Only letters and the minus (-) character are allowed.' => 'Sunt permise doar litere si semnul minus (-).',
    'Search name' => 'Cauta nume',
    'Search ref.' => 'Cauta ref.',
    'Search category' => 'Cauta categorie',
    'Permanently delete this product.' => 'Sterge permanent acest produs.',
    'See how your product sheet will look online: ALT+SHIFT+V' => 'Vezi cum va arata foaia cu produsul online: ALT+SHIFT+V',
    'Enable or disable the product on your shop: ALT+SHIFT+O' => 'Activeaza sau dezactiveaza produsul in magazinul tau: ALT+SHIFT+O',
    'Save the product and stay on the current page: ALT+SHIFT+S' => 'Salveaza produsul si ramai pe pagina actuala: ALT+SHIFT+S',
    'Save and duplicate this product, then go to the new product: ALT+SHIFT+D' => 'Salveaza si duplica acest produs, apoi treci la produsul nou: ALT+SHIFT+D',
    'Save and go back to the catalog: ALT+SHIFT+Q' => 'Salveaza si revino la catalog: ALT+SHIFT+Q',
    'Save and create a new product: ALT+SHIFT+P' => 'Salveaza si creeaza un nou produs: ALT+SHIFT+P',
    'Is the product a pack (a combination of at least two existing products), a virtual product (downloadable file, service, etc.), or simply a standard, physical product?' => 'Este produsul un pachet (o combinatie de cel putin doua produse existente), un produs virtual (fisier de descarcat, serviciu etc.), sau pur si simplu un produs standard, fizic?',
    'Where should the product be available on your site? The main category is where the product appears by default: this is the category which is seen in the product page\'s URL. Disabled categories are written in italics.' => 'Unde trebuie sa fie disponibil produsul pe site-ul tau? Categoria principala este locul unde produsul apare implicit: aceasta este categoria care este vazuta in URL-ul paginii produsului. Categoriile dezactivate sunt scrise cu caractere italice.',
    'Search categories' => 'Cauta categorii',
    'If you want to quickly create a new category, you can do it here. Don’t forget to then go to the Categories page to fill in the needed details (description, image, etc.).  A new category will not automatically appear in your shop\'s menu, please read the Help about it.' => 'Daca doresti sa creezi rapid o noua categorie, o poti face aici. Nu uita sa mergi apoi la pagina Categorii pentru a completa detaliile necesare (descriere, imagine, etc.). O noua categorie nu va aparea automat in meniul magazinului tau, te rugam sa citesti pe pagina Ajutor despre el.',
    'Does this combination have a different price? Is it cheaper or more expensive than the default retail price?' => 'Are aceasta combinatie un pret diferit? Este mai ieftina sau mai scumpa decat pretul implicit de vanzare cu amanuntul?',
    'Combinations are the different variations of a product, with attributes like its size, weight or color taking different values. To create a combination, you need to create your product attributes first. Go to Catalog > Attributes & Features for this!' => 'Combinatiile sunt diferite variatii ale unui produs, cu atribute cum ar fi dimensiunile, greutatea sau culoarea luand valori diferite. Pentru a crea o combinatie, trebuie sa creezi mai intai atributele produsului. Acceseaza Catalog > Atribute si caracteristici pentru aceasta!',
    'To add combinations, you first need to create proper attributes and values in [1]Attributes & Features[/1]. <br> When done, you may enter the wanted attributes (like "size" or "color") and their respective values ("XS", "red", "all", etc.) in the field below; or simply select them from the right column. Then click on "Generate": it will automatically create all the combinations for you!' => 'Pentru a adauga combinatii, trebuie mai intai sa creezi atribute si valori corespunzatoare in [1]Atribute si caracteristici[/1].<br>Cand ai terminat, poti introduce in campul de mai jos atributele dorite (precum "dimensiunea" sau "culoarea") si valorile respective ("XS", "rosu", "tot" etc.); sau pur si simplu selecteaza-le din coloana din dreapta. Apoi faci clic pe "Genereaza": toate combinatiile vor fi create automat pentru tine!',
    'To add combinations, you first need to create proper attributes and values in [1]%attributes_and_features_label%[/1]. <br> When done, you may enter the wanted attributes (like "size" or "color") and their respective values ("XS", "red", "all", etc.) in the field below; or simply select them from the right column. Then click on "%generate_label%": it will automatically create all the combinations for you!' => 'Pentru a adauga combinatii, trebuie mai intai sa creezi atribute si valori corespunzatoare in [1]%attributes_and_features_label%[/1]. <br>Cand ai terminat, poti introduce in caseta de dedesubt atributele dorite (precum "dimensiune" sau "culoare") si valorile respective ("XS", "rosu", "toate" etc.); sau pur si simplu selecteaza-le din coloana din dreapta. Apoi fa clic pe "%generate_label%": toate combinatiile vor fi create automat pentru tine!',
    'This is the human-readable URL, as generated from the product\'s name. You can change it if you want.' => 'Aceasta este adresa URL in format lizibil, generata de numele produsului. Poti sa o schimbi, daca doresti.',
    'When your product is disabled, choose to which page you’d like to redirect the customers visiting its page by typing the product or category name.' => 'Cand produsul tau este dezactivat, alege la ce pagina doresti sa fie redirectionati clientii care viziteaza pagina produsului, introducand un nume de produs sau categorie.',
    'No redirection (404) = Do not redirect anywhere and display a 404 "Not Found" page.' => 'Fara redirectionare (404) = Nu redirectioneaza si afiseaza o pagina 404 "Pagina nu a fost gasita".',
    'Permanent redirection (301) = Permanently display another product or category instead.' => 'Redirectionare permanenta (301) = Afiseaza permanent un alt produs sau categorie.',
    'Temporary redirection (302) = Temporarily display another product or category instead.' => 'Redirectionare temporara (302) = Afiseaza temporar un alt produs sau categorie.',
    'Display delivery time for a product is advised for merchants selling in Europe to comply with the local laws.' => 'Pentru conformarea cu legile Uniunii Europene, comerciantilor care vand in Europa le este recomandata afisarea timpului de livrare.',
    'edit' => 'editeaza',
    'If a carrier has a tax, it will be added to the shipping fees. Does not apply to free shipping.' => 'Daca transportatorul are o taxa, ea va fi adaugata la pretul livrarii. Nu se aplica livrarii gratuite.',
    'This interface allows you to specify the suppliers of the current product and its combinations, if any.' => 'Aceasta interfata iti permite sa specifici furnizorii produsului curent si ai combinatiilor sale, daca exista.',
    'You can specify supplier references according to previously associated suppliers.' => 'Poti specifica referintele furnizorului conform furnizorilor asociati in prealabil.',
    'When using the advanced stock management tool (see Shop Parameters > Products settings), the values you define (price, references) will be used in supply orders.' => 'Atunci cand utilizezi instrumentul de gestionare avansata a stocurilor (a se vedea Parametri Magazin > Setari Produse), valorile pe care le definesti (pret, referinte) vor fi utilizate in comenzile de aprovizionare.',
    'You can specify product reference(s) for each associated supplier. Click "Save" after changing selected suppliers to display the associated product references.' => 'Poti specifica referinta (referintele) produsului pentru fiecare furnizor asociat. Fa clic pe "Salveaza" dupa schimbarea furnizorilor selectati pentru a afisa referintele produsului asociat.',
    'You can specify product reference(s) for each associated supplier. Click "%save_label%" after changing selected suppliers to display the associated product references.' => 'Poti specifica referinta (sau referintele) produsului pentru fiecare furnizor asociat. Fa clic pe "%save_label%" dupa schimbarea furnizorilor selectati pentru a afisa referintele asociate produsului.',
    'This interface allows you to specify the warehouse in which the product is stocked.' => 'Aceasta interfata iti permite sa specifici in care depozite este stocat produsul.',
    'It is also possible to specify the location within the warehouse for each product or combination.' => 'Este de asemenea posibil sa se precizeze amplasarea in depozit pentru fiecare produs sau combinatie.',
    'Number of days this file can be accessed by customers. Set to zero for unlimited access.' => 'Numarul de zile in care acest fisier poate fi accesat de catre clienti. Seteaza la zero pentru a avea acces nelimitat.',
    'Upload a file from your computer (%maxUploadSize% max.)' => 'Incarca un fisier din calculator (%maxUploadSize% max.)',
    'The full filename with its extension (e.g. Book.pdf)' => 'Numele complet al fisierului cu extensie (de ex. Carte.pdf)',
    'Number of downloads allowed per customer. Set to 0 for unlimited downloads.' => 'Numarul de descarcari permise per client. Pune 0 pentru descarcari nelimitate.',
    'If set, the file will not be downloadable after this date. Leave blank if you do not wish to attach an expiration date.' => 'Daca este setata, fisierul nu va mai putea fi descarcat dupa aceasta data. Se lasa gol pentru a nu avea o data a expirarii.',
    'The minimum quantity required to buy this product (set to 1 to disable this feature). E.g.: if set to 3, customers will be able to purchase the product only if they take at least 3 in quantity.' => 'Cantitatea minima necesara pentru a cumpara acest produs (seteaza la 1 pentru a dezactiva aceasta functie). De ex.: daca este setat la 3, clientii vor putea sa cumpere produsul numai in cazul in care iau cel putin 3 in cantitate.',
    'The email will be sent to all the users who have the right to run the stock page. To modify the permissions, go to [1]Advanced Parameters > Team[/1]' => 'Mesajul va fi trimis tuturor utilizatorilor care au acces la pagina stocurilor. Pentru a modifica permisiunile, intra in [1]Parametri avansati > Echipa[/1]',
    'Combinations are the different variations of a product, with attributes like its size, weight or color taking different values. Does your product require combinations?' => 'Combinatiile sunt diferite variatii ale unui produs, cu atribute cum ar fi dimensiunea sa, greutatea sau culoarea luand valori diferite. Produsul tau are nevoie de combinatii?',
    'Advanced settings in [1][2]Combinations[/1]' => 'Setari avansate in [1][2]Combinatii[/1]',
    'Your reference code for this product. Allowed special characters: .-_#.' => 'Codul tau de referinta pentru acest produs. Caractere speciale permise: .-_#.',
    'How many products should be available for sale?' => 'Cate produse trebuie sa fie disponibile pentru vanzare?',
    'Advanced settings in [1][2]Quantities[/1]' => 'Setari avansate in [1][2]Cantitati[/1]',
    'This is the retail price at which you intend to sell this product to your customers. The tax included price will change according to the tax rule you select.' => 'Acesta este pretul de vanzare cu amanuntul cu care intentionezi sa vinzi acest produs clientilor tai. Pretul cu TVA inclusa se va schimba in functie de norma fiscala selectata.',
    'Advanced settings in [1][2]Pricing[/1]' => 'Setari avansate in [1][2]Preturi[/1]',
    'Tags are meant to help your customers find your products via the search bar.' => 'Etichetele sunt concepute pentru a ajuta clientii sa iti gaseasca produsele prin intermediul barei de cautare.',
    'Choose terms and keywords that your customers will use to search for this product and make sure you are consistent with the tags you may have already used.' => 'Alege termeni si cuvinte cheie pe care clientii le vor utiliza pentru a cauta acest produs si asigura-te ca sunt in concordanta cu etichetele pe care le utilizezi deja.',
    'You can manage tag aliases in the [1]Search section[/1]. If you add new tags, you have to rebuild the index.' => 'Poti gestiona aliasurile de etichete in sectiunea [1]Cautare[/1]. Daca adaugi etichete noi, trebuie sa reconstruiesti indexul.',
    'Not all shops sell new products. This option enables you to indicate the condition of the product. It can be required on some marketplaces.' => 'Nu toate magazinele vand produse noi. Aceasta optiune iti permite sa indici starea produsului. Acest lucru poate fi solicitat in unele locuri.',
    'ISBN is used internationally to identify books and their various editions.' => 'Codul ISBN este utilizat la nivel international pentru a identifica cartile si diferitele lor editii.',
    'This type of product code is widely used in the United States, Canada, the United Kingdom, Australia, New Zealand and in other countries.' => 'Acest tip de cod de produs este foarte utilizat in Statele Unite, Canada, Marea Britanie, Australia, Noua Zeelanda si alte tari.',
    'This type of product code is specific to Europe and Japan, but is widely used internationally. It is a superset of the UPC code: all products marked with an EAN will be accepted in North America.' => 'Acest tip de cod de produs este specific Europei si Japoniei, dar are o larga utilizare pe plan international. Este un superset al codului UPC: toate produsele marcate cu codul EAN sunt acceptate in America de Nord.',
    'MPN is used internationally to identify the Manufacturer Part Number.' => 'MPN este simbolul international al codului alocat produsului de catre producator (Manufacturer Part Number).',
    'This is the price at which you intend to sell this product to your customers. The tax included price will change according to the tax rule you select.' => 'Acesta este pretul la care intentionezi sa vinzi acest produs pentru clientii tai. Pretul incl. TVA se va schimba in functie de regula de taxare aleasa.',
    'Some products can be purchased by unit (per bottle, per pound, etc.),  and this is the price for one unit. For instance, if you’re selling fabrics, it would be the price per meter.' => 'Unele produse pot fi cumparate pe unitati (sticla, kilogram, etc), iar acesta este pretul pentru o singura unitate. De exemplu, daca ai de vanzare tesaturi, acesta ar fi pretul pe metru.',
    'The cost price is the price you paid for the product. Do not include the tax. It should be lower than the retail price: the difference between the two will be your margin.' => 'Pretul de cost este pretul pe care l-ai achitat pentru produs. Nu include TVA. Trebuie sa fie mai mic decat pretul de vanzare cu amanuntul: diferenta dintre cele doua va fi marja ta.',
    'You can set specific prices for customers belonging to different groups, different countries, etc.' => 'Poti stabili preturi specifice pentru clientii care apartin de diferite grupuri, diferite tari, etc.',
    'Sometimes one customer can fit into multiple price rules. Priorities allow you to define which rules apply first.' => 'Uneori un client se poate incadra in mai multe reguli de pret. Prioritatile iti permit sa definesti ordinea aplicarii regulilor de pret.',
    'Invalid token' => 'Jeton incorect',
    '[1]Invalid token[/1]: direct access to this link may lead to a potential security breach.' => '[1]Jeton nevalid[/1]: accesul direct la acest link poate duce la o bresa de securitate.',
    'Do you want to display this page?' => 'Vrei sa afisezi aceasta pagina?',
    'Yes, I understand the risks' => 'Da, inteleg riscurile',
    'Take me out of there!' => 'Scoate-ma de aici!',
    'Click on "Displayed" to index the category on your shop.' => 'Fa clic pe "Se afiseaza" pentru a indexa categoria in magazin.',
    'This is the main image for your category, displayed in the category page. The category description will overlap this image and appear in its top-left corner.' => 'Aceasta este imaginea principala pentru categoria ta, afisata pe pagina categoriei. Descrierea categoriei se va suprapune peste aceasta imagine si va aparea in coltul de sus-stanga.',
    'Displays a small image in the parent category\'s page, if the theme allows it.' => 'Afiseaza o imagine mica in pagina categoriei parinte, daca tema permite acest lucru.',
    'The category thumbnail appears in the menu as a small image representing the category, if the theme allows it.' => 'Miniatura categoriei apare in meniu ca o imagine mica reprezentand categoria, daca tema permite acest lucru.',
    'Only letters, numbers, underscore (_) and the minus (-) character are allowed.' => 'Doar litere, numere, underscore (_) si minus (-) sunt acceptate.',
