  'AdminDashboardHelp' => 
  array (
    'This mode displays sample data so you can try your dashboard without real numbers.' => 'Acest mod afiseaza date demonstrative ce iti permit sa testezi tabloul de bord fara date reale.',
    'Choose a fixed fee for each order placed in %currency% with %module%.' => 'Alege un comision fix pentru fiecare comanda plasata in %currency% cu modulul %module%.',
    'Choose a variable fee for each order placed in %currency% with %module%. It will be applied on the total paid with taxes.' => 'Alege un comision variabil pentru fiecare comanda plasata in %currency% cu modulul %module%. Va fi aplicat la totalul de plata incluzand taxele.',
    'Choose a fixed fee for each order placed with a foreign currency with %module%.' => 'Alege un comision fix pentru fiecare comanda plasata intr-o valuta straina cu modulul %module%.',
    'Choose a variable fee for each order placed with a foreign currency with %module%. It will be applied on the total paid with taxes.' => 'Alege un comision variabil pentru fiecare comanda plasata intr-o valuta straina cu modulul %module%. Va fi aplicat la totalul de plata incluzand taxele.',
    'For the carrier named %s, indicate the domestic delivery costs  in percentage of the price charged to customers.' => 'Pentru curierul numit  %s, indica costurile de livrare interna in procente din pretul platit de clienti.',
    'For the carrier named %s, indicate the overseas delivery costs in percentage of the price charged to customers.' => 'Pentru curierul numit  %s, indica costurile de livrare internationala in procente din pretul platit de clienti.',
    'Method: Indicate the percentage of your carrier margin. For example, if you charge $10 of shipping fees to your customer for each shipment, but you really pay $4 to this carrier, then you should indicate "40" in the percentage field.' => 'Procedura: Indica procentajul din adaosul stabilit de tine pentru livrare. De exemplu, daca pentru fiecare livrare ceri clientului 10 lei, dar curierului ii platesti 4 lei, ar trebui sa scrii "40" in casuta de procentaje.',
    'You should calculate this percentage as follows: ((total sales revenue) - (cost of goods sold)) / (total sales revenue) * 100. This value is only used to calculate the Dashboard approximate gross margin, if you do not specify the wholesale price for each product.' => 'Ar trebui sa calculezi acest procentaj dupa cum urmeaza: ((valoarea total a vanzarilor) - (costul total al bunurilor vandute)) / (valoarea totala a vanzarilor) * 100. Aceasta valoare este folosita numai la calculul aproximativ al marjei brute in Panoul de control, daca nu specifici un pret de aprovizionare pentru fiecare produs.',
    'You should calculate this value by making the sum of all of your additional costs per order.' => 'Poti calcula aceasta valoare insumand toate costurile aditionale per comanda.',
  ),
