  'AdminDesignHelp' => 
  array (
    'By default, all images settings are already installed in your store. Do not delete them, you will need it!' => 'In mod normal, configurarile imaginilor sunt deja facute in magazinul tau. Nu le sterge, iti vor trebui!',
    'Regenerates thumbnails for all existing images' => 'Regenereaza miniaturile pentru toate imaginile existente',
    'Please be patient. This can take several minutes.' => 'Te rugam sa ai rabdare. Aceasta actiune poate dura mai multe minute.',
    'Be careful! Manually uploaded thumbnails will be erased and replaced by automatically generated thumbnails.' => 'Atentie! Miniaturile incarcate manual vor fi sterse si inlocuite cu cele generate automat.',
    'Select "No" only if your server timed out and you need to resume the regeneration.' => 'Alege "Nu" doar daca serverul nu a raspuns in timp util si trebuie sa continui regenerarea.',
    'Please select a module' => 'Te rugam sa alegi un modul',
    'Select a module above before choosing from available hooks' => 'Alege un modul de mai sus, inainte de a alege dintre carligele disponibile',
    'Please specify the files for which you do not want the module to be displayed.' => 'Specifica fisierele pentru care nu doresti sa fie afisat modulul',
    'Please input each filename, separated by a comma (",").' => 'Introdu toate numele de fisiere, separate prin virgule (",").',
    'You can also click the filename in the list below, and even make a multiple selection by keeping the Ctrl key pressed while clicking, or choose a whole range of filename by keeping the Shift key pressed while clicking.' => 'De asemenea, poti clicai pe numele fisierului din lista de mai jos, poti face o selectie multipla prin mentinerea apasata a tastei Ctrl in timp ce clicai sau poti alege o secventa de nume de fisiere prin mentinerea apasata a tastei Shift in timp ce clicai.',
    'To add "tags" click in the field, write something, and then press "Enter."' => 'Pentru a adauga "etichete" in camp, scrie ceva si apoi apasa "Enter"',
    'JPEG images have a small file size and standard quality. PNG images have a larger file size, a higher quality and support transparency. Note that in all cases the image files will have the .jpg extension.' => 'Imaginile JPEG au o dimensiune mai mica si o calitate standard. Imaginile PNG au o dimensiune mai mare, calitate crescuta si suporta efectul de transparenta. De remarcat ca in toate cazurile fisierele imaginilor vor avea extensia .jpg.',
    'WARNING: This feature may not be compatible with your theme, or with some of your modules. In particular, PNG mode is not compatible with the Watermark module. If you encounter any issues, turn it off by selecting "Use JPEG".' => 'ATENTE: Aceasta caracteristica poate fi incompatibila cu tema ta sau cu unele dintre module. In mod particular, modul PNG nu este compatibil cu modulul Monograma (Watermark). Daca apar probleme, dezactiveaza-l selectand "Foloseste JPEG".',
    'Ranges from 0 (worst quality, smallest file) to 100 (best quality, biggest file).' => 'Variaza de la 0 (cea mai proasta calitate, cele mai reduse fisiere) pana la 100 (cea mai buna calitate, cele mai mari fisiere).',
    'Recommended: 90.' => 'Valoare recomandata: 90.',
    'PNG compression is lossless: unlike JPG, you do not lose image quality with a high compression ratio. However, photographs will compress very badly.' => 'Compresia PNG nu are pierderi: spre deosebire de JPG, nu pierzi din calitatea imaginii la valori mari ale comprimarii. Insa fotografiile nu pot fi comprimate bine in acest format.',
    'Ranges from 0 (biggest file) to 9 (smallest file, slowest decompression).' => 'Poate fi de la 0 (cel mai mare fisier) la 9 (cel mai mic fisier, cea mai lenta procesare).',
    'Recommended: 7.' => 'Valoare recomandata: 7.',
    'The maximum file size of pictures that customers can upload to customize a product (in bytes).' => 'Dimensiunea maxima a imaginilor pe care clientii le pot incarca pentru a personaliza un produs (in biti).',
    'Width of product customization pictures that customers can upload (in pixels).' => 'Latimea imaginilor de personalizare a produselor ce pot fi incarcate de clienti (in pixeli).',
    'Height of product customization pictures that customers can upload (in pixels).' => 'Inaltimea imaginilor de personalizare a produselor ce pot fi incarcate de clienti (in pixeli).',
    'This will generate an additional file for each image (thus doubling your total amount of images). Resolution of these images will be twice higher.' => 'Acest lucru va genera un fisier suplimentar pentru fiecare imagine (dubland astfel numarul total de imagini). Rezolutia acestor imagini va fi de doua ori mai mare.',
    'Enable to optimize the display of your images on high pixel density screens.' => 'Permite optimizarea afisarii imaginilor tale pe ecrane cu densitate inalta de pixeli.',
    'This should be set to yes unless you successfully moved images in "Images" page under the "Preferences" menu.' => 'Aceasta setare ar trebui sa fie "Da" doar daca nu ai mutat cu succes imaginile din pagina "Imagini" din meniul "Preferinte".',
    'Letters, underscores and hyphens only (e.g. "small_custom", "cart_medium", "large", "thickbox_extra-large").' => 'Numai litere, linii joase (underscore) si cratime (de ex. "small_custom", "cart_medium", "large", "thickbox_extra-large").',
    'Maximum image width in pixels.' => 'Latimea maxima aimaginii in pixeli.',
    'Maximum image height in pixels.' => 'Inaltimea maxima a imaginii in pixeli.',
    'This type will be used for Product images.' => 'Acest tip va fi folosit pentru imaginile produselor.',
    'This type will be used for Category images.' => 'Acest tip de imagine va fi folosit pentru categorii.',
    'This type will be used for Brand images.' => 'Acest tip va fi utilizat pentru imaginile marcii.',
    'This type will be used for Supplier images.' => 'Acest model va fi folosit pentru imaginile din sectiunea  Furnizor.',
    'This type will be used for Store images.' => 'Acest model va fi folosit pentru imaginile din sectiunea Magazin.',
    'E.g. address, addresses, attachment' => 'De ex. address, addresses, attachment',
    'Will appear on main page. Recommended size for the default theme: height %height% and width %width%.' => 'Apare in pagina principala. Dimensiunea recomandata pentru tema implicita: inaltimea %height% si latimea %width%.',
    'Warning: you can use a PNG file for transparency, but it can take up to 1 second per page for processing. Please consider using JPG instead.' => 'Atentie: poti utiliza un fisier PNG pentru transparenta, insa procesarea paginii poate dura pana la o secunda pentru fiecare imagine. Te rugam sa iei in considerare utilizarea in schimb a formatului JPG.',
    'It is the small icon that appears in browser tabs, next to the web address' => 'Este pictograma care apare pe tab-urile browser-ului, inainte de titlul paginii',
    'Be careful! Please check your theme in an RTL language before generating the RTL stylesheet: your theme could be already adapted to RTL.\\nOnce you click on "Adapt to RTL", any RTL-specific file that you might have added to your theme might be deleted by the created stylesheet.' => 'Atentie! Te rugam sa verifici tema intr-o limba care se scrie de la dreapta la stanga înainte de a genera fisierul CSS: tema ta ar putea fi deja adaptată la scrierea de la dreapta la stanga.\\nDupa ce faci clic pe "Adapteaza la RTL", orice fisier specific RTL pe care l-ai adaugat la tema este in pericol de a fi sters de catre fisierul nou creat.',
    'Used in the h1 page tag, and as the default title tag value.' => 'Folosit in tagul "h1" al paginii si ca valoare a tagului "title".',
    'Used to override the title tag value. If left blank, the default title value is used.' => 'Folosit pentru a suprascrie valoarea tagului "title". Daca nu este completat, va fi folosita valoarea implicita.',
    'Browse your computer files and select the Zip file for your new theme.' => 'Navigheaza prin fisierele computerului si selecteaza fisierul Zip pentru noua tema.',
    'Indicate the complete URL to an online Zip file that contains your new theme. For instance, "http://example.com/files/theme.zip".' => 'Indica adresa URL completa a unui fisier Zip care contine noua ta tema. De exemplu, "http://examplu.ro/fisiere/tema.zip".',
    'This selector lists the Zip files that you uploaded in the \'/themes\' folder.' => 'Acest selector listeaza fisierele Zip pe care le-ai incarcat in dosarul \'/teme\'.',
    'Create meaningful content' => 'Creeaza continut semnificativ',
    'Because it is not just selling products but also creating a universe, build pages to tell stories and catch your visitors’ interest, to turn them into loyal customers.' => 'Pentru ca nu este vorba doar de vanzarea de produse, ci si de crearea unui univers, construieste paginile pentru a spune povesti si pentru a capta interesul vizitatorilor, pentru a-i transforma in clienti fideli.',
    'Add new page category' => 'Adauga o noua pagina de categorie',
    'Add new page' => 'Adauga pagina noua',
    'This won\'t regenerate email templates, it only sets the default email theme for future generation (when a language is installed for example).' => 'Aceasta nu va regenera sabloanele de e-mail, ci va seta numai tema implicita pentru urmatoarea generare de sabloane (la instalarea unei limbi, de exemplu).',
    'PrestaShop\'s email templates are stored in the "mails" folder, but they can be overridden by your current theme\'s own "mails" folder. Using this option enables to overwrite emails from your current theme.' => 'Sabloanele de e-mail ale PrestaShop sunt stocate in dosarul "mails", dar vor fi folosite cele din dosarul "mails" al temei curente, daca exista. Utilizarea acestei optiuni permite suprascrierea sabloanelor din tema curenta.',
    'By default, existing email template files are not modified to avoid deleting any modification you may have done. Enable this option to force the overwrite.' => 'In mod normal, sabloanele existente de e-mail nu sunt modificate pentru a evita stergerea modificarilor facute de echipa ta. Activeaza aceasta optiune pentru a forta suprascrierea.',
    'No emails were detected in any theme folder so this field is disabled.' => 'Aceasta setare este dezactivata pentru ca nu au fost detectate sabloane de e-mail in niciunul dintre dosarele temelor.',
    'Will appear on email headers. If undefined, the header logo will be used.' => 'Apare in antetul e-mail-urilor. Daca nu este definit, va fi folosita sigla antet.',
    'Warning: if no invoice logo is available, the main logo will be used instead.' => 'Atentie: daca nu este specificata o sigla pentru factura, va fi folosit cea principala.',
    'Will appear on invoice headers.' => 'Va aparea in antetul facturilor.',
    'Use our [1]favicon generator on PrestaShop Marketplace[/1] to boost your brand image!' => 'Foloseste [1]generatorul nostru de favicon din PrestaShop Marketplace[/1] pentru a intari imaginea marcii tale!',
    'Will appear on your main page. Recommended size for the default theme: height %height% and width %width%.' => 'Va fi afisat in pagina principala. Dimensiunea recomandata pentru tema implicita: inaltime %height% si latime %width%.',
    'It is the small icon that appears in browser tabs, next to the title.' => 'Este icon-ul care apare pe tab-urile browser-ului, inainte de titlul paginii.',
    'Be careful! Please check your theme in an RTL language before generating the RTL stylesheet: your theme could be already adapted to RTL.
Once you click on "Adapt to RTL", any RTL-specific file that you might have added to your theme might be deleted by the created stylesheet.' => 'Atentie! Te rugam sa verifici tema intr-o limba care se scrie de la dreapta la stanga înainte de a genera fisierul CSS: tema ta ar putea fi deja adaptată la scrierea de la dreapta la stanga.
Cand faci clic pe "Adapteaza la RTL", fisierul nou creat ar putea sterge fisierele specifice RTL adaugate de echipa ta.',
    'Be careful! Please check your theme in an RTL language before generating the RTL stylesheet: your theme could be already adapted to RTL.
Once you enable the "%generate_rtl_label%" option, any RTL-specific file that you might have added to your theme might be deleted by the created stylesheet.' => 'Atentie! Te rugam sa verifici tema intr-o limba care se scrie de la dreapta la stanga înainte de a genera fisierul CSS: tema ta ar putea fi deja adaptată la scrierea de la dreapta la stanga.
Cand activezi optiunea "%generate_rtl_label%", orice fisier specific RTL ar putea fi sters de fisierul CSS nou creat.',
    'You must select a shop from the above list if you wish to choose a theme.' => 'Trebuie sa selectezi un magazin din lista de mai sus daca doresti sa selectezi o tema',
    'You are editing this page for a specific shop or group. Click "Yes" to check all fields, "No" to uncheck all.' => 'Editati aceasta pagina pentru un anumit magazin sau grup. Apasa "Da" pentru a bifa toate campurile, "Nu" pentru a le debifa pe toate.',
    'If you check a field, change its value, and save, the multistore behavior will not apply to this shop (or group), for this particular parameter.' => 'Daca bifezi un camp, schimbi valoarea acestuia si salvezi, comportamentul multi-magazin nu se va aplica acestui magazin (sau grup), pentru acest parametru.',
    'You are editing this page for a specific shop or group. Click "%yes_label%" to check all fields, "%no_label%" to uncheck all.' => 'Editeaza aceasta pagina pentru un anumit magazin sau grup. Fa clic pe "%yes_label%" pentru a bifa toate casetele sau pe "%no_label%" pentru a le debifa pe toate.',
  ),
  'AdminDesignNotification' => 
  array (
    'Your page will be saved as a draft' => 'Pagina ta va fi salvata ca schita',
    'You can choose to keep your images stored in the previous system. There\'s nothing wrong with that.' => 'Poti alege pastrarea imaginilor folosind sistemul vechi. Nu este nimic in neregula cu acest lucru.',
    'You can also decide to move your images to the new storage system. In this case, click on the "Move images" button below. Please be patient. This can take several minutes.' => 'De asemenea, poti decide mutarea imaginilor catre noul sistem de stocare. In acest caz, fa clic pe butonul "Mutare imagin" de mai jos. Te rugam sa ai rabdare. Acest lucru poate dura mai multe minute.',
    'After moving all of your product images, set the "Use the legacy image filesystem" option above to "No" for best performance.' => 'Dupa mutarea tututuror imaginilor tale de produs, seteaza pe ”Nu” optiunea "Foloseste sistemul vechi de fisiere " pentru a obtine cea mai buna performanta.',
    'Be careful! Depending on the options selected, former manually uploaded thumbnails might be erased and replaced by automatically generated thumbnails.' => 'Atentie! Depinzand de optiunile alese, miniaturile incarcate manual inainte ar putea fi sterse si inlocuite automat de miniaturi generate automat.',
    'Also, regenerating thumbnails for all existing images can take several minutes, please be patient.' => 'In plus, regenerarea miniaturilor pentru toate imaginile existente poate dura mai multe minute. Te rugam sa ai rabdare.',
    'If you want to order/move the following data, please select a shop from the shop list.' => 'Daca doresti sa muti/ordonezi urmatoarele date, selectioneaza un magazin din lista de magazine',
