    'Your online store needs to have a proper carrier registered in PrestaShop as soon as you start shipping your products. This means sending yours parcels using your local postal service, or having a contract with a private carrier which in turn will ship your parcels to your customers. In order to have PrestaShop suggest the most adequate carrier to your customers during their order checkout process, you need to register all the carriers with which you have chosen to work.' => 'Magazinul tau online trebuie sa aiba un operator de transport adecvat, inregistrat in PrestaShop, imediat ce incepi sa iti livrezi produsele. Aceasta inseamna trimiterea coletelor tale utilizand serviciul postal local, sau incheierea unui contract cu un operator de transport privat, care, la randul sau, va livra coletele clientilor tai. Pentru ca PrestaShop sa sugereze cel mai adecvat transportator pentru clientii tai in timpul procesului de finalizare a comenzii, este necesar sa inregistrezi toti transportatorii cu care ai ales sa lucrezi.',
    'PrestaShop comes with a number of carrier modules that you can activate. You can also buy carrier modules on the PrestaShop Addons marketplace. Recommended modules are listed below: install the module that matches your carrier, and configure it!' => 'PrestaShop vine cu o serie de module de transportatori pe care le poti activa. Poti cumpara, de asemenea, module cu transportatori de pe PrestaShop Addons. Modulele recomandate sunt enumerate mai jos: instaleaza modulul care se potriveste cu transportatorul tau si configureaza-l!',
    'If there is no existing module for your carrier, then you can register that carrier by hand using the information that it can provide you: shipping rates, regional zones, size and weight limits, etc. Click on the "Add new carrier" button below to open the Carrier Wizard, which will help you register a new carrier in a few steps.' => 'In cazul in care nu exista niciun modul existent pentru transportatorul tau, poti inregistra acel transportator manual, utilizand informatiile pe care acesta ti le poate oferi: tarifele de transport, zonele regionale, limita de dimensiune si greutate etc. Apasa pe butonul "Adauga un transportator nou" de mai jos pentru a porni ghidul de creare a transportatorilor, care te va ajuta sa inregistrezi un transportator nou in cativa pasi.',
    'Note: DO NOT register a new carrier if there already exists a module for it! Using a module will be much faster and more accurate!' => 'Nota: NU inregistra un transportator nou in cazul in care deja exista un modul pentru acesta! Cu ajutorul unui modul va fi mult mai rapid si mai exact!',
    'The carrier\'s name will be displayed during checkout.' => 'Numele transportatorului va fi afisat in timpul verificarii cosului de produse.',
    'The delivery time will be displayed during checkout.' => 'Timpul estimat de livrare va fi afisat la finalizarea comenzii.',
    'Delivery tracking URL: Type \'@\' where the tracking number should appear. It will be automatically replaced by the tracking number.' => 'URL-ul de urmarire a livrarii: introdu \'@\' acolo unde ar trebui sa apara numarul de urmarire. Astfel, acesta va fi inlocuit automat cu numarul de urmarire.',
    'For example: \'http://example.com/track.php?num=@\' with \'@\' where the tracking number should appear.' => 'De exemplu: \'http://example.com/track.php?num=@\' cu \'@\' in locul in care trebuie sa apara numarul de urmarire.',
    'Include the handling costs (as set in Shipping > Preferences) in the final carrier price.' => 'Include costurile de procesare (conform configurarii din Livrare > Preferinte) in pretul final al curierului.',
    'Out-of-range behavior occurs when no defined range matches the customer\'s cart (e.g. when the weight of the cart is greater than the highest weight limit defined by the weight ranges).' => 'Comportamentul in afara intervalului apare cand niciun interval din cele definite nu corespunde cu cosul clientului (de ex. cand greutatea produselor din cos depaseste limita maxima de greutate definita in intervalele de greutate).',
    'Maximum width managed by this carrier. Set the value to "0", or leave this field blank to ignore.' => 'Latimea maxima permisa de acest transportator. Se seteaza aceasta valoare ca "0", sau se lasa campul gol pentru a fi ignorata.',
    'The value must be an integer.' => 'Valoarea trebuie sa fie un numar intreg',
