    'Maximum weight managed by this carrier. Set the value to "0", or leave this field blank to ignore.' => 'Greutatea maxima acceptata de acest transportator. Se seteaza aceasta valoare ca "0", sau se lasa campul gol pentru a fi ignorata.',
    'Allowed characters: letters, spaces and "%special_chars%".' => 'Caractere permise: litere, spatii si "%special_chars%".',
    'For in-store pickup, enter 0 to replace the carrier name with your shop name.' => 'Pentru a ridica produsul(ele) din magazin, introdu 0 pentru a inlocui numele curierului cu cel al magazinului tau.',
