    'Enable the carrier in the front office.' => 'Activeaza curierul in front office.',
    'Carrier name displayed during checkout' => 'Numele curierului afisat in timpul comenzii',
    'Upload a logo from your computer.' => 'Incarca o sigla din calculatorul tau.',
    'or' => 'sau',
    'Estimated delivery time will be displayed during checkout.' => 'Timp estimat de livrare va fi afisat in timpul finalizarii comenzii.',
    'Delivery tracking URL: Type \'@\' where the tracking number should appear. It will then be automatically replaced by the tracking number.' => 'URL-ul de urmarire a livrarii: introdu \'@\' acolo unde ar trebui sa apara numarul de urmarire. Astfel, acesta va fi inlocuit automat cu numarul de urmarire.',
    'The zones in which this carrier will be used.' => 'Zonele in care va fi utilizat acest transportor.',
    'Group access' => 'Access de grup',
    'Apply both regular shipping cost and product-specific shipping costs.' => 'Se aplica atat costul normal de livrare cat si costurile de livrare specifice unui produs.',
