    'Your shop\'s default carrier.' => 'Transportatorul implicit al magazinului tau.',
    'You need to register all the carriers with which you have chosen to work. PrestaShop comes with a selection of carrier modules you can install right below the page or buy on [1]Addons marketplace[/1].' => 'Trebuie sa inregistrezi toti transportatorii cu care ai ales sa lucrezi. PrestaShop vine cu o selectie de module de transport pe care le poti instala chiar din aceasta pagina sau le cumpara din  [1]magazinul PrestaShop Addons[/1].',
    'If there is no existing module for your carrier, you can register it manually by clicking on "[1]" but before, please make sure you did not register a new carrier if a module already exists for it!' => 'Daca nu exista inca un modul pentru transportatorul tau, il poti inregistra manual facand clic pe "[1]", dar mai intai te rugam sa te asiguri ca nu ai inregistrat un transportator nou daca exista deja un modul pentru acesta!',
    'Your shop\'s default carrier' => 'Curierul implicit al magazinului tau',
