  'AdminShopparametersHelp' => 
  array (
    'There is a huge quantity of data, so each connection corresponding to a referrer is indexed. You can also refresh this index by clicking the "Refresh index" button. This process may take a while, and it\'s only needed if you modified or added a referrer, or if you want changes to be retroactive.' => 'Este o cantitate imensa de date, astfel incat fiecare conexiune corespunzatoare unui referer este indexata. Se poate improspata acest index dand clic pe butonul de mai sus. Poate dura destul de mult si este necesar doar daca ai modificat sau ai adaugat un referer si doresti ca modificarile sa fie retroactive.',
    'Your data is cached in order to sort it and filter it. You can refresh the cache by clicking on the "Refresh cache" button.' => 'Datele tale sunt stocate in memoria cache pentru a le sorta si filtra. Poti actualiza memoria cache, facand clic pe butonul "Actualizare cache".',
    'Direct traffic can be quite resource-intensive. You should consider enabling it only if you have a strong need for it.' => 'Traficul direct poate fi foarte mare consumator de resurse. Ar trebui considerata activarea sa doar daca ai un server de baza de date puternic si o nevoie puternica pentru aceste date.',
    'Show me more' => 'Arata mai mult',
    'Definitions:' => 'Definitii:',
    'The "http_referer" field is the website from which your customers arrive.' => 'Campul `http_referer`este site-ul de unde vin clientii tai',
    'For example, visitors coming from Google will have an "http_referer" value like this one: "http://www.google.com/search?q=prestashop".' => 'De exemplu vizitatorii care vin din Google vor avea o valoarea \'http_referer\' ca acesta: "http://www.google.ro/search?q=prestashop".',
    'If the visitor arrives directly (by typing the URL of your shop, or by using their bookmarks, for example), the http_referer will be empty.' => 'Daca vizitatorul vine direct (prin introducerea URL-ului sau prin folosirea de bookmarks, de exemplu), http_referer va fi gol.',
    'If you\'d like to view all the visitors coming from Google, you can type "%google%" in this field. Alternatively, you can type "%google.fr%" if you want to view visitors coming from Google France, only.' => 'Deci daca vrei toti vizitatorii care au venit de la Google, poti scrie \\"%google%\\" in acest camp, sau \\"%google.ro%\\" daca vrei doar vizitatorii care vin din Google Romania.',
    'The "request_uri" field is the URL from which the customers come to your website.' => 'Campul "request_uri" este URL-ul de unde clientii vin pe site-ul tau.',
    'For example, if the visitor accesses a product page, the URL will be like this one: "%smusic-ipods/1-ipod-nano.html".' => 'De exemplu, in cazul in care vizitatorul acceseaza o pagina de produs, URL-ul va fi ca acesta: "%smuzica-ipods/1-ipod-nano.html".',
    'This is helpful because you can add tags or tokens in the links pointing to your website.' => 'Acest lucru este folositor pentru poti include etichete sau jetoane in linkurile care trimit spre site-ul tau.',
    'For example, you can post a link (such as "%sindex.php?myuniquekeyword" -- note that you added "?myuniquekeyword" at the end of the URL) in an online forum or as a blog comment, and get visitors statistics for that unique link by entering "%%myuniquekeyword" in the "request_uri" field.' => 'De exemplu, poti posta un link (cum ar fi "%sindex.php?myuniquekeyword" -- noteaza adaugarea lui "?myuniquekeyword" la sfarsitul adresei) intr-un forum online sau intr-un comentariu pe un blog si, prin introducerea "%%myuniquekeyword" in campul "request_uri", obtii statistici despre vizitatori pentru acel link unic.',
    'This method is more reliable than the "http_referer" one, but there is one disadvantage: if a search engine references a page with your link, then it will be displayed in the search results and you will not only indicate visitors from the places where you posted the link, but also those from the search engines that picked up that link.' => 'Aceasta metoda este mai sigura decat "http_referer", insa exista un dezavantaj: in cazul in care un motor de cautare face referire la o pagina cu link-ul tau, atunci acesta va fi afisat in rezultatele cautarii si va indica nu doar vizitatorii din locurile unde ai postat linkul, dar, de asemenea, si pe cei din motoarele de cautare, care au luat acel link.',
    'The "Include" fields indicate what has to be included in the URL.' => 'Campurile "Includere" indica ce trebuie sa contina URL-ul.',
    'The "Exclude" fields indicate what has to be excluded from the URL.' => 'Campurile "Excludere" indica ce trebuie sa fie exclus din URL.',
    'When using simple mode, you can use a wide variety of generic characters to replace other characters:' => 'Cand este folosit modul simplu, se pot folosi caractere generice care pot inlocui orice caracter:',
    '"_" will replace one character. If you want to use the real "_", you should type this: "\\\\_".' => '"_" va inlocui un caracter. Daca vrei sa folosesti "_" real, va trebui sa tastezi: "\\\\_".',
    '"%" will replace any number of characters. If you want to use the real "%", you should type this: "\\\\%".' => '"%" va inlocui orice numar de caractere. Daca vrei sa folosesti "%" real, va trebui sa tastezi: "\\\\%".',
    'The Simple mode uses the MySQL "LIKE" pattern matching, but for a higher potency you can use MySQL\'s regular expressions in the Expert mode.' => 'Modul simplu foloseste potrivirea de modele "LIKE" din MySQL, insa pentru o cautare mai puternica, poti folosi si alte expresii MySQL in mod Expert.',
    'Take a look at MySQL\'s documentation for more details.' => 'Vezi documentatia MySQL pentru mai multe detalii.',
    'Get help!' => 'Solicita ajutor!',
    'e.g. 10:00AM - 9:30PM' => 'de ex. 10:00 - 18:30',
    'Further information regarding this contact.' => 'Informatii suplimentare despre acest contact.',
    'Image width in pixels. Enter "0" to use the original size.' => 'Latimea imaginii in pixeli. Introdu "0" pentru a se folosi dimensiunile originale.',
    'Image height in pixels. Enter "0" to use the original size.' => 'Inaltimea imaginii in pixeli. Introdu "0" pentru a se folosi dimensiunile originale.',
    'The group defined for your un-identified visitors.' => 'Grupul definit pentru vizitatorii neidentificati.',
    'The group defined for your identified guest customers (used in guest checkout).' => 'Grupul definit pentru clientii tai identificati de tip oaspete (utilizat in finalizarea comenzilor oaspetilor).',
    'The group defined for your identified registered customers.' => 'Grupul definit pentru clientii tai inregistrati.',
    'Automatically apply this value as a discount on all products for members of this customer group.' => 'Pentru membrii acestui grup de clienti, se va aplica in mod automat aceasta valoare ca o reducere pentru toate produsele.',
    'How prices are displayed in the order summary for this customer group.' => 'Cum sunt afisate preturile in sumarul comenzii pentru acest grup de clienti.',
    'Customers in this group can view prices.' => 'Clientii din acest grup pot vedea preturile.',
    '%group_name% - All persons without a customer account or customers that are not logged in.' => '%group_name% - Toate persoanele fara un cont de client sau clientii care nu sunt autentificati.',
    '%group_name% - All persons who placed an order through Guest Checkout.' => '%group_name% - Toate persoanele care au plasat o comanda din cont de oaspete.',
    '%group_name% - All persons who created an account on this site.' => '%group_name% - Toate persoanele care si-au creat un cont pe acest site.',
    'PrestaShop has three default customer groups:' => 'PrestaShop are trei grupuri prestabilite de clienti:',
    'Need to hide prices for all groups? Save time, enable catalog mode in Product Settings instead.' => 'Ai nevoie sa ascunzi preturile pentru toate grupurile? Economiseste timp activand modul catalog in CONFIGUREAZA > Parametri magazin > Produse.',
    'Leave blank if no change.' => 'Lasa gol daca nu sunt modificari.',
    'Fee given for each visit.' => 'Comision acordat pentru fiecare vizita.',
    'Fee given for each order placed.' => 'Comision pentru fiecare comanda plasata.',
    'If you know how to use MySQL regular expressions, you can use the [1]expert mode[/1].' => 'Daca stii sa folosesti expresii regulate in MySQL, poti folosi [1]modul expert[/1].',
    'Enable the automatic indexing of products. If you enable this feature, the products will be indexed in the search automatically when they are saved. If the feature is disabled, you will have to index products manually by using the links provided in the field set.' => 'Activeaza indexarea automata a produselor. Daca activeaza aceasta caracteristica, produsele vor fi indexate pentru cautare in mod automat cand sunt salvate. Daca nu o activeaza, va trebui sa indexezi manual produsele folosind linkurile din acest bloc.',
    'By default, to search for “blouse”, you have to enter “blous”, “blo”, etc (beginning of the word) – but not “lous” (within the word).' => 'In mod implicit, pentru a cauta "bluza", trebuie sa introduci "bluz", "blu" etc. (inceputul cuvantului) - si nu "luz" (in interiorul cuvantului).',
    'With this option enabled, it also gives the good result if you search for “lous”, “ouse”, or anything contained in the word.' => 'Cu aceasta optiune activata, cautarea ofera un rezultat bun in cazul in care cauti "luz", "uza", sau orice alte litere continute in cuvant.',
    'Enable search within a whole word, rather than from its beginning only.' => 'Activeaza cautarea in interiorul unui cuvant, nu numai la inceputul acestuia.',
    'It checks if the searched term is contained in the indexed word. This may be resource-consuming.' => 'Se verifica daca termenul cautat este continut in cuvantul indexat. Aceasta poate avea un consum semnificativ de resurse.',
    'By default, if you search "book", you will have "book", "bookcase" and "bookend".' => 'In mod implicit, cand cauti ”carte”, vei gasi ”carte”, ”cartela” si "cartelare".',
    'With this option enabled, it only gives one result “book”, as exact end of the indexed word is matching.' => 'Cu aceasta optiune activa, vei avea numai un singur rezultat: "carte", deoarece se cauta sfarsitul exact al cuvantului.',
    'Enable more precise search with the end of the word.' => 'Activeaza o cautare mai precisa la sfarsitul cuvantului.',
    'It checks if the searched term is the exact end of the indexed word.' => 'Aceasta verifica daca termenul cautat este sfarsitul exact al cuvantului indexat.',
    'Only words this size or larger will be indexed.' => 'Vor fi indexate doar cuvintele care au cel putin acest numar de caractere.',
    'Please enter the index words separated by a "|".' => 'Introdu cuvintele separate prin "|".',
    'Enter each alias separated by a comma (e.g. \'prestshop,preztashop,prestasohp\').' => 'Introduci fiecare pseudonim separat cu virgula (de ex. \'prestshop,preztashop,prestasohp\').',
    'Forbidden characters: <>;=#{}' => 'Caractere nepermise: <>;=#{}',
    'Search this word instead.' => 'Se cauta acest cuvant in loc.',
    'By default, the fuzzy search is enabled. It means spelling errors are allowed, e.g. you can search for "bird" with words like "burd", "bard" or "beerd".' => 'In mod implicit,  este activa cautarea de tip "fuzzy". Aceasta inseamna ca erorile de ortografie sunt permise, de ex. poti cauta "animal" cu cuvinte precum "animol", "anemal" sau "aniimal".',
    'Enable approximate string matching.' => 'Activeaza potrivirea aproximativa a sirurilor de caractere.',
    'Note that this option is resource-consuming: the more you search, the longer it takes.' => 'Retine ca aceasta optiune consuma multe resurse: cu cat cauti mai multe, cu atat va dura mai mult.',
    'Disabling this option will require exact spelling for the search to match results.' => 'Dezactivarea acestei optiuni va face ca expresiile sa fie cautate exact in forma in care au fost introduse.',
    'Only words fewer or equal to this maximum length will be searched.' => 'Se vor cauta doar cuvinte mai scurte sau cel mult de aceasta lungime maxima.',
    'This parameter will only be used if the fuzzy search is activated: the lower the value, the more tolerant your search will be.' => 'Acest parametru va fi utilizat numai pentru cautarea de tip "fuzzy": cu cat valoarea lui este mai mica, cu atat va fi mai toleranta cautarea.',
    'This field does not refer to the shop name visible in the front office.' => 'Acest camp nu se refera la numele vizibil in Front Office al magazinului.',
    'Follow [1]this link[/1] to edit the shop name used on the front office.' => 'Urmeaza [1]acest link[/1] pentru a edita numele magazinului afisat in paginile publice.',
    'You can\'t edit the shop group because the current shop belongs to a group with the "share" option enabled.' => 'Nu se poate edita grupul de magazine pentru ca magazinul curent apartine unui grup cu optiuni de partajare activate.',
    'This is the root category of the store that you\'ve created. To define a new root category for your store, [1]please click here[/1].' => 'Aceasta este categoria radacina pentru magazinul creat de tine. Pentru a defini o noua categorie radacina a magazinului tau, [1]te rugam sa faci clic aici[/1].',
    'By selecting associated categories, you are choosing to share the categories between shops. Once associated between shops, any alteration of this category will impact every shop.' => 'Prin selectarea categoriilor asociate, alegi sa folosesti in comun categoriile in magazine. Odata asociate intre magazine, orice modificare a unei categorii asociate va afecta toate magazinele pentru care aceste categorii sunt asociate.',
    'Upload an icon from your computer (File type: .gif, suggested size: 16x16).' => 'Incarca o pictograma de pe computerul tau (tipul fisierului: .gif, dimensiune recomandata: 16x16).',
    'Whether or not to display this store.' => 'Daca se afiseaza sau nu magazinul.',
    'Storefront picture.' => 'Imaginea magazinului.',
    'Displayed in emails sent to customers.' => 'Afisat in e-mailurile trimise clientilor.',
    'Shop registration information (e.g. SIRET or RCS).' => 'Date fiscale despre magazin (ex. CUI sau CIF).',
    'Contact name (e.g. Customer Support).' => 'Nume de contact (de ex. Asistenta pentru clienti).',
    'Emails will be sent to this address.' => 'E-mail-urile vor fi trimise la aceasta adresa.',
    'If enabled, all messages will be saved in the "Customer Service" page under the "Customer" menu.' => 'Daca este activat, toate mesajele vor fi salvate in pagina "Serviciu clienti" din meniul "Client"',
    'After a customer logs in, you can recall and display the content of his/her last shopping cart.' => 'Dupa ce un client se autentifica, poti afisa continutul ultimului sau cos de cumparaturi.',
    'Minimum time required between two requests for a password reset.' => 'Intervalul de timp minim permis intre doua cereri de resetare a parolei.',
    'Activate or deactivate B2B mode. When this option is enabled, B2B features will be made available.' => 'Se activeaza sau se dezactiveaza mod B2B. Cand aceasta optiune este activata devin disponibile o serie de caracteristici B2B (business to business).',
    'Display or not the birth date field.' => 'Afiseaza sau nu campul pentru data nasterii.',
    'Display or not the partner offers tick box, to receive offers from the store\'s partners.' => 'Afiseaza sau nu caseta de bifare pentru ofertele de la parteneri, pentru a primi oferte din partea partenerilor magazinului.',
    'Send an email with a summary of the account information after registration.' => 'Trimite un e-mail cu un rezumat al informatiilor despre cont dupa inregistrare.',
    'We recommend that you deactivate your store while performing maintenance. Note that it will not disable the webservice.' => 'Recomandam dezactivarea magazinului in timpul lucrarilor de intretinere. Noteaza ca aceasta nu va dezactiva serviciul web.',
    'Allow IP addresses to access the store, even in maintenance mode. Use a comma to separate them (e.g. 42.24.4.2,127.0.0.1,99.98.97.96).' => 'Permite anumitor adrese IP sa acceseze magazinul, chiar si in modul de intretinere. Utilizeaza o virgula pentru a le separa (de exemplu, 42.24.4.2,127.0.0.1,99.98.97.96).',
    'Display a customized message when the store is disabled.' => 'Afiseaza un mesaj personalizat cand magazinul este dezactivat.',
    'If you own an SSL certificate for your shop\'s domain name, you can activate SSL encryption (https://) for customer account identification and order processing.' => 'In cazul in care posezi un certificat SSL pentru numele de domeniu al magazinului, ai posibilitatea de a activa criptarea SSL (https://) pentru identificarea contului de client si procesarea comenzilor.',
    'When enabled, all the pages of your shop will be SSL-secured.' => 'Cand e activa, toate paginile magazinului vor fi securizate cu SSL.',
    'Enable or disable token in the Front Office to improve PrestaShop\'s security.' => 'Activeaza sau dezactiveaza jetonul in Front Office pentru imbunatatirea securitatii.',
    'Allow iframes on text fields like product description. We recommend that you leave this option disabled.' => 'Se permit iframe-uri in campurile de text cum este descrierea produsului. Iti recomandam sa dezactivezi aceasta optiune.',
    'Clean the HTML content on text fields. We recommend that you leave this option enabled.' => 'Curata continutul HTML din campurile de text. Iti recomandam sa activezi aceasta  optiune.',
    'You can choose among 6 different ways of rounding prices. "Round up away from zero ..." is the recommended behavior.' => 'Poti alege dintre 6 moduri diferite de rotunjire a preturilor. "Rotunjire in plus cand este la jumatate" este comportamentul recomandat.',
    'You can choose when to round prices: either on each item, each line or the total (of an invoice, for example).' => 'Poti alege cand sa rotunjesti preturile: fie pentru fiecare element, fiecare linie sau totalul (unei facturi, de exemplu).',
    'Enable best sellers page on your front office even when its respective module is disabled.' => 'Se permite accesul la pagina cu cele mai cumparate produse in front office, chiar daca modulul corespunzator nu este activ.',
    'The multistore feature allows you to manage several e-shops with one Back Office. If this feature is enabled, a "Multistore" page will be available in the "Advanced Parameters" menu.' => 'Facilitatea multi-magazin permite administrarea mai multor magazine intr-o singura interfata. Daca este activata aceasta caracteristica, va aparea o pagina "Magazine multiple" in "Parametri avansati".',
    'Enable suppliers page on your front office even when its module is disabled.' => 'Activeaza pagina furnizorilor chiar daca modulul corespunzator este dezactivat.',
    'Enable brands page on your front office even when its module is disabled.' => 'Activeaza pagina marcilor chiar daca modulul corespunzator este dezactivat.',
    'Display an overview of the addresses, shipping method and cart just before the order button (required in some European countries).' => 'Afiseaza o prezentare generala a adreselor, metodei de livrare si cosului chiar inainte de butonul de comanda (obligatoriu in unele tari europene).',
    'Allow guest visitors to place an order without registering.' => 'Permite vizitatorilor oaspeti sa creeze o comanda fara sa se inregistreze.',
    'Disable the option to allow customers to reorder in one click from the order history page (required in some European countries).' => 'Se dezactiveaza optiunea de a permite clientilor sa sorteze cu un clic din pagina de istoric al comenzilor (cerinta obligatorie in unele tari europene).',
    'Set to 0 to disable this feature.' => 'Seteaza la 0 pentru a dezactiva aceasta caracteristica.',
    'Automatically updates the shipping costs when you edit an order.' => 'Actualizeaza automat costurile de transport atunci cand editezi o comanda.',
    'Require customers to accept or decline terms of service before processing an order.' => 'Se cere clientilor acordul cu termenii serviciului inainte de procesarea comenzii.',
    'Choose the page which contains your store\'s terms and conditions of use.' => 'Alege pagina care contine termenii si conditiile de utilizare a magazinului tau.',
    'Allow the customer to ship orders to multiple addresses. This option will convert the customer\'s cart into one or more orders.' => 'Se ofera clientilor posibilitatea livrarii comenzilor la adrese multiple. Aceasta optiune va converti cosul clientului in una sau mai multe comenzi.',
    'It allows you to delay shipping if your customers request it.' => 'Permite amanarea expedierii la cererea clientilor.',
    'Suggest gift-wrapping to customers.' => 'Se ofera clientilor posibilitatea ambalarii de tip cadou.',
    'Set a price for gift wrapping.' => 'Seteaza un pret pentru impachetarea cadoului.',
    'Set a tax for gift wrapping.' => 'Seteaza o taxa pentru impachetarea cadoului.',
    'Suggest recycled packaging to customer.' => 'Se sugereaza impachetare in materiale reciclate clientilor.',
    'Only letters, numbers and underscores ("_") are allowed.' => 'Sunt permise numai litere, numere si undescore ("_").',
    'Email template for both .html and .txt.' => 'Sablon de e-mail pentru .html si .txt.',
    'characters' => 'caractere',
    'Note that the label will be displayed only if backorders are denied.' => 'Retine ca eticheta va fi afisata numai daca comenzile pentru produse indisponibile sunt interzise.',
    'Enable this option if you want to display your product\'s attributes in its meta title.' => 'Activeaza aceasta optiune daca vrei sa incluzi atributele produsului in meta title.',
    'Enable this option only if your server allows URL rewriting (recommended).' => 'Activeaza aceaasta optiune numai daca serverul tau permite rescrirea adreselor URL (optiune recomandata).',
    'URL rewriting (mod_rewrite) is not active on your server, or it is not possible to check your server configuration. If you want to use Friendly URLs, you must activate this mod.' => 'Rescrierea de URL-uri (mod_rewrite) nu este activa pe server sau nu este posibila verificarea configurarii. Daca doresti sa folosesti URL-uri prietenoase trebuie sa ai activat acest mod.',
    'Enable this option only if you have problems with URL rewriting.' => 'Activeaza aceasta optiune doar daca ai probleme cu rescrierea de URL-uri pentru unele pagini.',
    'Some of PrestaShop\'s features might not work correctly with a specific configuration of Apache\'s mod_security module. We recommend to turn it off.' => 'Unele dintre functiile din PrestaShop ar putea sa nu functioneze corect cu anumita configuratie a modulului mod_security din Apache. Iti recomandam sa il dezactivati.',
    'Enable this option if you want to allow accented characters in your friendly URLs. You should only activate this option if you are using non-Latin characters; for all the Latin charsets, your SEO will be better without this option.' => 'Activeaza aceasta optiune daca doresti sa permiti folosirea diacriticelor in adresele URL prietenoase. Ar trebui sa o activezi numai daca utilizezi caractere non-latine; pentru toate seturile de caractere latine, evaluarea SEO va fi mai buna fara aceasta optiune.',
    'The catalog mode is actually to disable products checkout (prices, add to cart, etc.) on your shop, like a retail website does.' => 'Modul catalog dezactiveaza toate functiile de magazin on-line (preturi, cosul de cumparaturi, etc).',
    'Set the maximum size of the summary of your product description (in characters).' => 'Seteaza lungimea maxima a descrierii produsului (in caractere).',
    'How to calculate quantity discounts.' => 'Modul de calcul al reducerilor la cantitate.',
    'When active, friendly URL will be updated on every save.' => 'Daca aceasta setare este activa, adresele URL prietenoase vor fi actualizate la fiecare salvare.',
    'When active, new products will be activated by default during creation.' => 'Atunci cand este activa, produsele noi vor fi activate in mod implicit in timpul crearii.',
    'Catalog mode disables the shopping cart on your store. Visitors will be able to browse your products catalog, but not buy them.' => 'Modul catalog dezactiveaza cosul de cumparaturi in magazinul tau. Vizitatorii vor putea vedea produsele, dar nu le vor putea cumpara.',
    'Have specific needs? Edit particular groups to let them see prices or not.' => 'Ai nevoi particulare? Editeaza separat grupurile pentru a le permite sa vada preturile sau nu.',
    'Display product prices when in catalog mode.' => 'Afiseaza preturile produselor in modul catalog.',
    'Set to "0" to disable this feature.' => 'Seteaza 0 pentru a dezactiva aceasta caracteristica',
    'Display or hide the "add to cart" button on category pages for products that have attributes forcing customers to see product details.' => 'Afiseaza sau ascunde butonul "Adauga in cos" pe paginile categoriilor pentru produsele care au atribute pentru a forta clientii sa vada detaliile produsului.',
    'In the volume discounts board, display the new price with the applied discount instead of showing the discount (ie. "-5%").' => 'Pe panoul reducerilor de volum se va afisa pretul nou cu reducerea aplicata in loc de a afisa reducerea (de ex. "-5%").',
    'Display the "%add_to_cart_label%" button when a product has attributes' => 'Afiseaza butonul "%add_to_cart_label%" cand produsul are atribute',
    'Display or hide the "%add_to_cart_label%" button on category pages for products that have attributes forcing customers to see product details.' => 'Afiseaza sau ascunde butonul "%add_to_cart_label%" pe paginile categoriilor pentru produsele care au atribute, pentru a forta clientii sa vada detaliile produsului.',
    'If an attribute is not available in every product combination, it will not be displayed.' => 'Daca un atribut nu este disponibil in fiecare combinatie de produse, acesta nu va fi afisat.',
    'Number of products displayed per page. Default is 10.' => 'Numarul de produse afisate intr-o pagina. Implicit este 10.',
    'The order in which products are displayed in the product list.' => 'Ordinea in care sunt afisate produsele in lista de produse',
    'Default order method for product list.' => 'Metoda implicita de comandare pentru lista de produse.',
    'By default, the Add to Cart button is hidden when a product is unavailable. You can choose to have it displayed in all cases.' => 'In mod implicit, butonul Adauga in cos este ascuns cand produsul este indisponibil. Poti decide sa fie afisat permanent.',
    'Advised for European merchants to be legally compliant (eg: Delivered within 3-4 days)' => 'Recomandat pentru conformarea cu legile UE (de ex.: livrare in 3-4 zile)',
    'Advised for European merchants to be legally compliant (eg: Delivered within 5-7 days)' => 'Recomandat pentru conformarea cu legile UE (de ex.: livrare in 5-7 zile)',
    'When selling packs of products, how do you want your stock to be calculated?' => 'Atunci cand vinzi pachete de produse, cum doresti sa fie calculat stocul?',
    'By default, the "%add_to_cart_label%" button is hidden when a product is unavailable. You can choose to have it displayed in all cases.' => 'In mod implicit, butonul "%add_to_cart_label%" este ascuns cand produsul este indisponibil. Poti decide sa fie afisat permanent.',
    'Allows you to delay shipping at your customers\' request.' => 'Iti permite sa intarzii livrarea la cererea clientului.',
    'Invalid characters: numbers and' => 'Caractere nepermise: numere si',
    'Status will be highlighted in this color. HTML colors only.' => 'Stadiul va fi evidentiat cu aceasta culoare. Numai culori HTML.',
    'Order\'s return status name.' => 'Numele stadiului de returnare a comenzii.',
    'Order status (e.g. \'Pending\').' => 'Stadiu de comanda (de ex. \'In procesare\').',
    'You can search for a new domain name or add a domain name that you already own. You will be redirected to your PrestaShop account.' => 'Poti sa cauti un nume nou de domeniu sau sa adaugi un nume de domeniu pe care il detii deja. Vei fi redirectionat la contul tau din PrestaShop.',
    'Invalid characters:' => 'Caractere nepermise:',
    'Name of the related page.' => 'Numele paginii inrudite.',
    'Title of this page.' => 'Titlul acestei pagini.',
    'A short description of your shop.' => 'O scurta descriere a magazinului.',
    'List of keywords for search engines.' => 'Lista de cuvinte cheie pentru motoarele de cautare.',
    'For instance, "contacts" for http://example.com/shop/contacts to redirect to http://example.com/shop/contact-form.php' => 'De exemplu, "contact" pentru http://exemplu.ro/magazin/contact redirectioneaza catre http://exemplu.ro/magazin/contact-form.php',
    'Only letters and hyphens are allowed.' => 'Doar litere si cratime sunt permise.',
    'To add tags, click in the field, write something, and then press the "Enter" key.' => 'Pentru a adauga o eticheta clicaie in casuta, scrie numele etichetei si apasa tasta "Enter".',
    'Enable this option if you want to allow accented characters in your friendly URLs.' => 'Activeaza aceasta optiune daca doresti sa permiti diacritice in adresele URL prietenoase.',
    'You should only activate this option if you are using non-latin characters ; for all the latin charsets, your SEO will be better without this option.' => 'Aceasta optiune ar trebui activata doar daca se folosesc caractere non-latine; pentru toate seturile de caractere latine SEO va fi mai buna fara aceasta optiune.',
    'Activate or deactivate your shop (It is a good idea to deactivate your shop while you perform maintenance. Please note that the webservice will not be disabled).' => 'Activeaza sau dezactiveaza magazinul. Este o idee buna sa dezactivezi magazinul in perioadele de timp in care se lucreaza la el. Trebuie sa stii ca serviciile web nu vor fi dezactivate.',
    'IP addresses allowed to access the front office even if the shop is disabled. Please use a comma to separate them (e.g. 42.24.4.2,127.0.0.1,99.98.97.96)' => 'Adresele de IP care au acces la front office, chiar daca magazinul este dezactivat. Foloseste virgula pentru a le separa (de ex. 42.24.4.2,127.0.0.1,99.98.97.96)',
    'Custom text displayed on maintenance page while shop is deactivated.' => 'Text personalizat afisat pe pagina de intretinere in timpul in care magazinul este dezactivat.',
    'If you want to enable SSL on all the pages of your shop, activate the "Enable on all the pages" option below.' => 'In cazul in care doresti sa activezi SSL pe toate paginile magazinului, activeaza optiunea "Activeaza pe toate paginile" de mai jos.',
    'Choose how many decimals you want to display' => 'Alege cate zecimale vrei sa afiseze',
    'Enable brands and suppliers pages on your front office even when their respective modules are disabled.' => 'Permite accesul la paginile de producatori si de furnizori in front office, chiar daca modulele corespunzatoare sunt dezactivate.',
  ),
  'AdminShopparametersNotification' => 
  array (
    'Caution: The discount applied to a category does not stack with the overall reduction but instead replaces it.' => 'Atentie: reducerea aplicata unei categorii nu se adauga la reducerea globala ci o inlocuieste.',
    'Only products that have this category as the default category will be affected.' => 'Vor fi afectate doar produsele care au aceasta categorie ca si categorie implicita.',
    'The module \'%s\' must be activated and configurated in order to have all the statistics' => 'Modulul \'%s\' trebuie sa fie activat si configurat pentru a avea toate statisticile',
    'You cannot delete this shop (customer and/or order dependency)' => 'Nu poti sterge acest magazin (exista dependente de client si/sau comenzi)',
    'Click here to set a URL for this shop.' => 'Da clic aici pentru a seta un URL pentru acest magazin',
    'Width and height must be numeric values.' => 'Latimea si inaltimea trebuie sa fie valori numerice.',
    'The discount value is incorrect (must be a percentage).' => 'Valoarea reducerii este incorecta (trebuie sa fie un procentaj).',
    'Wrong category ID.' => 'ID categorie gresit.',
    'The discount value is incorrect.' => 'Valoarea reducerii este incorecta.',
    'You cannot save group reductions.' => 'Nu se pot salva reducerile de grup.',
    'An error occurred while updating this group.' => 'A aparut o eroare la actualizarea grupului.',
    'Please install the "%modulename%" module in order to give your affiliates access to their own statistics.' => 'Te rugam sa instalezi modulul "%modulename%" pentru a permite afiliatilor tai accesul la propriile lor statistici.',
    'Percent of the sales.' => 'Procent din vanzari.',
    'Aliases and results are both required.' => 'Aliasurile si rezultatele sunt toate obligatorii.',
    'Is not a valid result' => 'nu este un rezultat valid.',
    'Is not a valid alias' => 'Nu este un alias valid',
    'Creation successful' => 'Crearea a reusit',
    'We are thrilled to introduce you to the fuzzy search, one of the new features from 1.7.7! Please note that it is still in beta version, so feel free to share improvement ideas on GitHub to have it enhanced.' => 'Suntem entuziasmati sa iti prezentam cautarea de tip "fuzzy", una dintre noile functii ale versiunii 1.7.7! Te rugam sa retii ca este inca in versiunea beta, asa ca nu ezita sa ne impartasesti pe GitHub ideile tale de imbunatatire.',
    'This is not a valid IP address:' => 'Se pare ca aceasta nu este o adresa IP:',
    'You cannot delete this shop (customer and/or order dependency).' => 'Nu poti sterge acest magazin (exista dependente de client si/sau comenzi).',
    'Please create some sub-categories for this root category.' => 'Te rugam creeaza cateva sub-categorii pentru acesta categorie-radacina.',
    'You need to select at least the root category.' => 'Trebuie sa selectezi cel putin o categorie radacina.',
    'Warning: You won\'t be able to change the group of this shop if this shop belongs to a group with one of these options activated: Share Customers, Share Quantities or Share Orders.' => 'Atentie: nu vei putea schimba grupul acestui magazin daca el apartine unui grup care are una aceste optiuni activate: Clienti comuni, Stocuri comune sau Comenzi comune.',
    'You can only move your shop to a shop group with all "share" options disabled -- or to a shop group with no customers/orders.' => 'Poti muta magazinul doar intr-un grup cu toate optiunile de partajare dezactivate sau intr-un grup fara clienti/comenzi.',
    'For security reasons, you cannot delete default order statuses.' => 'Din motive de securitate, nu se pot sterge stadiile implicite ale comenzilor.',
    'An address located in a country containing states must have a state selected.' => 'O adresa situata intr-o tara care contine judete trebuie sa aibe un judet selectat.',
    'Latitude and longitude are required.' => 'Latitudine si longitudine sunt necesare.',
    'The specified state is not located in this country.' => 'Judetul/statul/comitatul specificat nu este localizat in aceasta tara.',
    'Before being able to use this tool, you need to:' => 'Inainte de a putea folosi aceasta unealta, trebuie sa:',
    'Create a blank .htaccess in your root directory.' => 'Creeaza un fisier .htacces gol in folderul radacina.',
    'Give it write permissions (CHMOD 666 on Unix system).' => 'Da permisia de scriere (CHMOD 666 pe un sistem Unix).',
    'The Base URI is not valid.' => 'Adresa URI de baza nu este valida.',
    'An order status with the same name already exists: %s' => 'Exista deja un stadiu cu acelasi nume al comenzii: %s',
    'You must define an SMTP server and an SMTP port. If you do not know it, use the PHP mail() function instead.' => 'Trebuie definit un server SMTP si un port SMTP. Daca nu stii cum, folosesti functia mail() a PHP.',
    'Assign a valid page if you want it to be read.' => 'Atribuie o pagina valida daca vrei sa poata fi citita.',
    'Your robots.txt file MUST be in your website\'s root directory and nowhere else (e.g. http://www.example.com/robots.txt).' => 'Fisierul robots.txt TREBUIE sa fie in directorul radacina al site-ului si nicaieri altundeva (de ex. http://www.site.ro/robots.txt).',
    'Generate your "robots.txt" file by clicking on the following button (this will erase the old robots.txt file)' => 'Genereaza fisier "robots.txt" apasand pe urmatorul buton (aceasta va sterge vechiul fisier robots.txt)',
    '1) Create a blank robots.txt file in your root directory.' => '1) Creeaza un fisier robots.txt gol in directorul radacina.',
    'Before you can use this tool, you need to:' => 'Inainte sa poti folosi acest instrument, trebuie sa:',
    '2) Give it write permissions (CHMOD 666 on Unix system).' => '2) Ii dai permisiuni de scriere (CHMOD 666 pe un sistem Unix).',
    '1) Create a blank .htaccess file in your root directory.' => '1) Creeaza un fisier .htaccess gol in directorul radacina al site-ului.',
    'Here you can set the URL for your shop. If you migrate your shop to a new URL, remember to change the values below.' => 'Aici poti seta URL-ul pentru magazin. Daca migrezi magazinul la un alt URL, nu uita sa schimbi valorile mai jos.',
    'The multistore option is enabled. If you want to change the URL of your shop, you must go to the "Multistore" page under the "Advanced Parameters" menu.' => 'Optiunea de magazine multiple este activata. Daca doresti sa schimbi URL-ul site-ului trebuie sa deschizi pagina "Magazine multiple" din meniul "Parametri avansati".',
    'This section enables you to change the default pattern of your links. In order to use this functionality, PrestaShop\'s "Friendly URL" option must be enabled, and Apache\'s URL rewriting module (mod_rewrite) must be activated on your web server.' => 'Aceasta sectiune va faciliteaza modificarea sabloanelor implicite ale linkurilor tai. Pentru a folosi aceasta functionalitate, optiunea "Adrese URL prietenoase" din PrestaShop > SEO si adrese URL trebuie sa fie activata si modulul de rescriere a adreselor URL din Apache (mod_rewrite) trebuie sa fie activat pe serverul tau de web.',
    'There are several available keywords for each route listed below; note that keywords with * are required!' => 'Exista cateva cuvinte-cheie disponibile pentru fiecare ruta din lista de mai jos; atentie, cele cu * sunt obligatorii!',
    'To add a keyword in your URL, use the {keyword} syntax. If the keyword is not empty, you can add text before or after the keyword with syntax {prepend:keyword:append}. For example {-hey-:meta_title} will add "-hey-my-title" in the URL if the meta title is set.' => 'Pentru a adauga un cuvant-cheie in adresa URL, folosesti sintaxa {keyword}. Daca respectivul cuvant-cheie nu este gol, ii poti adauga text inainte sau dupa cu sintaxa {prepend:keyword:append}. De examplu {-hey-:meta_title} va adauga "-hey-my-title" in adresa URL daca meta-titlul este configurat.',
    'You can only display the page list in a shop context.' => 'Se poate afisa lista de pagini doar in contextul unui magazin.',
  ),
