    '<b>Warning: You cannot use this tool to upgrade your store anymore.</b><br /><br />You already have <b>PrestaShop version %version% installed</b>.<br /><br />If you want to upgrade to the latest version, please read our documentation: <a href="%doc%">%doc%</a>' => '<b>Atentie: Nu mai poti folosi aceasta unealta pentru a-ti actualiza magazinul.</b><br /><br />Deja ai <b>PrestaShop %version% instalat</b>.<br /><br />Daca doresti sa actualizezi la ultima versiune, te rugam sa citesti documentatia: <a href="%doc%">%doc%</a>',
