    'Revocation Terms within ToS' => 'Termeni de Anulare in TS',
    'Includes content from the Revocation Terms page within the Terms of Services (ToS).' => 'Include continut din pagina Termeni de anulare in Termenii Serviciului (TS).',
    'If enabled, make sure the Revocation Terms are associated with a page below (Legal Content Management).' => 'Daca este activa, asigura-te ca Termeni de Anulare sunt asociati cu pagina de mai jos (Administrare de Continut Legal).',
    'Revocation for virtual products' => 'Anulare pentru produse virtuale',
    'Adds a mandatory checkbox when the cart contains a virtual product. Use it to ensure customers are aware that a virtual product cannot be returned.' => 'Adauga o bifa obligatorie cand cosul contine un produs virtual. Foloseste-o pentru a te asigura ca imposibilitatea returnarii unui produs virtual este cunoscuta de clienti.',
    'Require customers to renounce their revocation right when purchasing virtual products (digital goods or services).' => 'Solicita clientilor sa renunte la dreptul lor de revocare atunci cand achizitioneaza produse virtuale (bunuri sau servicii digitale).',
    '\'From\' price label (when combinations)' => 'Eticheta de pret "De la" (cand exista combinatii)',
