    'Please inform your customers about how the order is legally confirmed.' => 'Te rugam sa informezi clientii despre modul legal de confirmare a comenzii.',
    'Features' => 'Caracteristici',
    'Enable \'Reordering\' feature' => 'Activeaza functia ”Comanda din nou”',
    'If enabled, the \'Reorder\' option allows customers to reorder in one click from their Order History page.' => 'Daca este activa, optiunea "Comanda din nou" permite clientilor sa repete comanda cu un singur clic din pagina lor de Istorie a Comenzilor.',
